import './App.css';
import Home from "./pages/home";
import {BrowserRouter, Route, Routes} from "react-router-dom";

import { useState } from 'react';

function App() {
  //빈 배열을 만들어줌
  const [products,setProducts] = useState([]);
  return (
    <BrowserRouter>

      <Routes>
        <Route path="/" element={<Home products={products} setProducts={products} />} />
      </Routes>

    </BrowserRouter>
  );
}

export default App;
